sys_variable_value.value:
(function execute(inputs, outputs) {
    var netUtils = new global.networkHelper();
    var newIpAddress = netUtils.incrementIpAddress(inputs.ip_address, inputs.increment_by);

    outputs.new_ip_address = newIpAddress;

})(inputs, outputs);

